  false,\n\t\"url\": null,\n\t\"notes\": \"The Natural Resources and Conservation
  Planning Division of the National Wildlife Refuge System established the Wilderness
  Fellowship Program in 2011. The program commences its second year in cooperation
  with 12 refuges across six regions, providing opportunities for students or recent
  graduates to gain valuable career experience while advancing stewardship of wilderness
  resources. Each Wilderness Fellow will spend up to six months in a wilderness refuge
  to support the development of wilderness character monitoring and associated tasks.
  Fellows will focus on wilderness character by producing baseline assessments, entering
  data into the interagency database, recording observations of wilderness experiences,
  and advancing the inventory and monitoring strategy. They will also assist on a
  variety of other refuge projects and gain a better understanding of Refuge System
  culture.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
